import React from "react";

import { Helmet } from "react-helmet";
const Error404 = () => {
  return (
    <div>
      <Helmet>
        <title>ERROR NOT FOUND</title>
      </Helmet>
      <h1>This is Apge Of Error404</h1>
    </div>
  );
};

export default Error404;
